;; @@
(defn pareto-coords
  [[k1 k2] result]
  (let [pareto-front (set (pareto/non-dominated-individuals [k1 k2] (:elite result)))
        coord-extract (fn [i] [(k1 i) (k2 i)])]
    [(map coord-extract (:rabble result))
     (map coord-extract pareto-front)]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/pareto-coords</span>","value":"#'algebolic.demo.spea2/pareto-coords"}
;; <=

;; @@
(def run-config
  (let [vars '[x]
        functions (expression/get-function-symbols #{:plus :minus :times :sin :cos})
        terminals (expression/make-terminals vars)
        size-limit 80
        min-size 15
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 100
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 45}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 3) :repeat 10}]})
        score-functions {:complexity score/size
                         :error (partial score/abs-error vars data)}]
    {:initial-zeitgeist      (evolution/make-zeitgeist
                               (genetics/full-population functions terminals 100 6))
     :ea-config              ea-config
     :transformations        [(partial transform/apply-to-fraction-of-genotypes
                                       (partial transform/hill-descent
                                                genetics/twiddle-constants
                                                (:error score-functions))
                                       0.5)
                              (partial transform/apply-to-fraction-of-genotypes
                                       algebra/expand-full
                                       0.1)
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/trim-hard size-limit))
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/boost-hard min-size
                                                #(genetics/random-full-tree functions terminals 3)))]
     :score-functions        score-functions
     :stopping-condition     #(>= (:age %) 1500)
     :reporting-function     (fn [z]
                               (swap! coords #(conj % (pareto-coords [:complexity :error] z)))
                               (print ".")
                               (flush))}))
